INSERT INTO `tbl_maquinas` VALUES ('4', 'Torno CNC Kia Kit-450 ', 'Torno  especializado en medianas y altas producciones. </br>Máximo diámetro de corte: 6” Máxima longitud de corte:  11.8”.\r\n', '3', '1', 'images/fulls/04.jpg');
INSERT INTO `tbl_maquinas` VALUES ('5', 'Torno CNC Hyundai Hit-200 ', 'Torno  especializado en bajas y medianas producciones. </br>Máximo diámetro de corte: 9” Máxima longitud de corte:  13.4”.\r\n', '3', '1', 'images/fulls/05.jpg');
INSERT INTO `tbl_maquinas` VALUES ('6', 'Torno CNC Hyundai Kit-400 ', 'Torno especializado en bajas y medianas producciones. </br>Máximo diámetro de corte: 6” Máxima longitud de corte:  8”.\r\n', '3', '1', 'images/fulls/06.jpg');
