INSERT INTO `tbl_maquinas` VALUES ('8', 'Centro de Maquinado Hyundai KIA VX650 ', 'Equipado con control Fanuc 18i, cambiador automático de 24 herramientas y un motor de 20 hp que brinda 10,000 rpm. </br>Máxima longitud de corte en ‘X’:  24.8”  ‘Y’:  19.7”  ‘Z’:  19.68”  </	br>Incluy', '3', '2', 'images/fulls/08.jpg');
INSERT INTO `tbl_maquinas` VALUES ('9', 'Centro de Maquinado Hardinge VMC 600 II ', 'Equipado con control Siemens y cambiador automático de 24 herramientas y un motor de 18 hp que brinda 8,000 rpm. </br>Máxima longitud de corte en ‘X’:  24.8”  ‘Y’:  19.7”  ‘Z’:  19.68”.\r\n', '3', '2', 'images/fulls/09.jpg');
INSERT INTO `tbl_maquinas` VALUES ('10', 'Centro de Maquinado Deckel Maho DMC 63v ', 'Equipado con control Heidenhein TNC-430 y cambiador automático de 24 herramientas y un motor de 18 hp que brinda 8,000 rpm. </br>Máxima longitud de corte: ‘X’:  24.8”  ‘Y’:  19.7”  ‘Z’:  19.68”.\r\n', '3', '2', 'images/fulls/10.jpg');
INSERT INTO `tbl_maquinas` VALUES ('11', 'Fresa convencional de 3 ejes', 'Nuberu también cuenta con una fresa con reglas digitales que brinda apoyo a los centros de maquinado cuando así se requiere.\r\n', '3', '2', 'images/fulls/11.jpg');
INSERT INTO `tbl_maquinas` VALUES ('12', 'Erosionadora de penetración de Control Numérico, marca Mitsubishi, modelo EA-8. ', 'Rango de maquinado: X 11.8\", Y 9.8\", Z 9.8\". \r\n', '3', '3', 'images/fulls/12.jpg');
INSERT INTO `tbl_maquinas` VALUES ('13', 'Erosionadora de penetración de Control Numérico, Mitsubishi EA-12D\r\n', 'Rango de Maquinado: X 15.7\", Y 11.8\", Z 11.8\". ', '3', '3', 'images/fulls/13.jpg');
INSERT INTO `tbl_maquinas` VALUES ('14', 'Rectificadora cilíndrica Studer S40-4. ', 'Control Siemens, diámetro máximo de trabajo: 14”, distancia entre centros: 39”.  </br>Equipada con dispositivo de rectificado interior y marposs.\r\n', '3', '4', 'images/fulls/14.jpg');
INSERT INTO `tbl_maquinas` VALUES ('15', 'Rectificadora de planos Ocamoto 12-24 ST. ', 'Equipada con ciclos automáticos de rectificado. </br>Profundidad máxima de rectificado: 12”, longitud máxima de rectificado: 24”.\r\n', '3', '4', 'images/fulls/15.jpg');
INSERT INTO `tbl_maquinas` VALUES ('16', 'Rectificadora convencional', 'Además Nuberu cuenta con una rectificadora cilíndrica convencional que brinda apoyo a nuestro equipo automatizado.\r\n', '3', '4', 'images/fulls/16.jpg');
INSERT INTO `tbl_maquinas` VALUES ('17', 'Comparador Optico OGP ', 'Equipado con ejes motorizados, pantalla con ejes digitales Di-metric Plus con compensación electrónica de precisión y torreta motorizada de seis posiciones con diversos lentes que alcanzan hasta los 7', '3', '5', 'images/fulls/17.jpg');
INSERT INTO `tbl_maquinas` VALUES ('18', 'Mesa de Coordenadas Brown & Sharpe Micro-xcel (CMM) ', 'Mesa de coordenadas CNC 100% motorizada y automática. </br>Equipada con software PC- DMIS 3.2, generador de curvas y superficies, que entre otras funciones permite efectuar ingeniería inversa, etc. </', '3', '5', 'images/fulls/18.jpg');
INSERT INTO `tbl_maquinas` VALUES ('19', 'Maquilas ', 'Partes para válvulas de aire acondicionado. - Refacciones de válvulas para el control de fluidos. - Terminales eléctricas para estaciones de poder. - Conectores  para la industria Aeroespacial. - Div', '1', null, 'images/fulls/M1.jpg');
INSERT INTO `tbl_maquinas` VALUES ('20', 'Proyectos Especiales ', 'Partes para moldes de inyección de PET. - Moldes de soplo de PET. - Carretillas y Chucks para el cierre de latas. - Carretillas para alpinismo. - Unidades de rotograbado. - Rodillos de impresión.\r\n', '2', null, 'images/fulls/PE1.jpg');
